INSERT INTO `artwork` VALUES (3,'467fefd4-8ba7-11e6-80c4-e5922c263bb3','Liby','Golden Particles','And Golden Waves',1,1,2,'https://vimeo.com/156116002','2015-06-20 23:28:00','After Effects','Particle','<p>金色的粒子！灵感来源于某颁奖视频。感觉这个可以被用来当模板。不过以后再说。</p><p>不过这个看起来真不错啊！</p>',0),(4,'9b3c5a2e-8e06-11e6-80c4-e5922c263bb3','Liby','ACES','Redefine your vision',1,1,2,'https://vimeo.com/156116093','2015-11-27 08:00:00','After Effects','After Effects, Special Effects, ACES','<p>XZMan学长好！这次我的作业做得怎么样咧？？话说这次是参考了一下Ash Thorp的ARES这部短片，那个实在是做的好棒啊，InfoGraphics什么的。我一定要认真学习。</p><p><!-- Description Summernote comes here --></p>',0),(5,'3f4b30ba-8e0a-11e6-80c4-e5922c263bb3','Liby','Particle Field XN','A mess of particles',1,1,2,'https://vimeo.com/156115068','2014-06-02 03:20:00','After Effects','After Effects, Particular','本来想拿很多种颜色的粒子来练练调色，不过感觉这次并没有很成功。原版的灵感......好像没有来源，只是单纯的练习。',0),(6,'e85a0366-8e0a-11e6-80c4-e5922c263bb3','Liby','全てがFになる','Pixelated automata in After Effects',1,4,1,'','2015-11-23 16:00:00','After Effects','After Effects, 全てがFになる','实在是很喜欢すべてがFになる这部番，也超级喜欢它的OP和ED。这次仿制的是它的OP片段。嘛说到好看的话肯定是一般般，但是这次的效果有用到Trapcode Form的很神奇的用法。Fractal Noise的算法真的可以仔细学习好久呢。除此之外就是用了Ball Action处理过的字体。是不是显得更加数字感了呢？\n                        <!-- Description Summernote comes here -->\n                    ',0),(7,'69dad440-8f89-11e6-80c4-e5922c263bb3','Liby','Deep Sea','深海&樱花',1,1,2,'https://vimeo.com/156116034','2015-11-23 16:00:00','After Effects','After Effects, 櫻子さんの足下には死体が埋まっている, 打ち寄せられた忘却の残響に','<p>超喜欢樱子小姐的足下埋着尸体这一部番，更喜欢打ち寄せられた忘却の残響に这一首歌，番剧的ED，超级推荐，已经循环了好几天了。</p><p>话说我的Particular好像出了点问题，感觉不是很能把樱花的感觉做出来。顶上的闪光是难得一用的Trapcode Shine插件做的。</p>',0),(8,'93db345a-8f8a-11e6-80c4-e5922c263bb3','Liby','Twitching Spectrum Aimer','奇怪的抖动的瞄准器（？',1,1,2,'https://vimeo.com/156114945','2014-02-15 00:00:00','After Effects','After Effects, Sound Waveform','这个奇怪的“瞄准器”，灵感来自于Bionicle Mahri里面的CG动画的开头。还是挺好看的我觉得，虽然单调了点。',0),(9,'f5442008-8f8a-11e6-80c4-e5922c263bb3','Liby','Cool A','只是一个A',1,1,2,'https://vimeo.com/156114910','2013-12-16 16:00:00','After Effects','After Effects','哇现在还能找到2013年做的东西。。仔细想想十大和游园会的视频也是那时做的呢。。有点怀念呢。。这个好像是当年教大红米饭他们的第一个特效。。不过我本身也是从Video Copilot上学来的就是了。。<!-- Description Summernote comes here -->',0),(10,'7d395b7c-8f8b-11e6-80c4-e5922c263bb3','Liby','文乃の幸せ理論','陽炎きゃああああ',1,1,2,'https://vimeo.com/156115026','2014-05-03 00:00:00','After Effects','After Effects, Kagero, 陽炎, 文乃','<p>迷上了阳炎！XDDDDDD</p><p>这一段是想模仿文乃的幸福理论的mv里的一个分镜。mv做的都好赞啊，画风也很喜欢。看看以后是不是可以多仿制几个做练习。</p>',0),(11,'e7807c36-8f8b-11e6-80c4-e5922c263bb3','Liby','夏令时记录','陽炎きゃああああ',1,1,2,'https://vimeo.com/156114976','2014-05-13 00:00:00','After Effects','After Effects, Kagero, 陽炎, 夏令时记录','这就是说好的再做一点关于阳炎的特效，不过这个大部分好像都是自己脑补的。花了很多精力去做云和那种夏日清凉的感觉。大概就是这样（？',0),(12,'45f733ea-8f8c-11e6-80c4-e5922c263bb3','Liby','奇怪的环','就当Element 3D的练习',1,1,1,'','2014-06-11 00:00:00','After Effects','After Effects, Element 3D','其实并不知道自己在做什么。跑到星巴克去乱做一通。嗯我应该滚去写Vinet的代码的嗯。',0),(13,'70cb860a-8f8e-11e6-80c4-e5922c263bb3','Liby','Aim To London','瞄准线',1,1,2,'https://vimeo.com/156115049','2014-06-11 00:00:00','After Effects','After Effects, PPRDMUN, expression','最后这货变成了PPRDMUN 2014视频的主要特效。但这个有趣的点在于，中间那条斜线是用表达式写出来的，于是我们可以拖动中间的准星，线会自动地把起始点和终点连起来。JavaScript真是好玩呢。',0),(14,'f1614dd6-8f8e-11e6-80c4-e5922c263bb3','Liby','Mekaku City Actors','目隠シティアックタース',1,1,2,'https://vimeo.com/156109018','2014-06-24 07:00:00','After Effects','After Effects, Particular','<p>又来啦！阳炎的Mock。这次做的比前两次认真多了呢。我觉得还是挺好看的，配色上来说也是。</p><p>真的好喜欢阳炎</p>',0),(15,'51af7fdc-8f8f-11e6-80c4-e5922c263bb3','Liby','Cataphrect OS','Aldnoah/Zero',1,1,2,'https://vimeo.com/156115082','2014-08-13 00:00:00','After Effects','After Effects, Aldnoah Zero, OS','这次仿制的是Aldnoah Zero第一季op里面迅速闪过去的一幕，是地球的装甲骑兵的os启动界面。我觉得还挺帅的呢！对于这类info graphics加上景深感觉瞬间就不一样了。',0),(16,'6c3b5aa8-9023-11e6-80c4-e5922c263bb3','Liby','Macro Link','Bilibili Macro Link Mock',1,1,2,'https://vimeo.com/156115104','2014-08-16 00:00:00','After Effects','Plexus, Bilibili','最近好像bilibili要搞线下活动。突然想起了自己新搞了个Plexus插件，所以就拿过来用了。好像还算一般好看......',0),(17,'c496bcd8-9023-11e6-80c4-e5922c263bb3','Liby','Throughout the Tube','穿过时空隧道（？',1,1,2,'https://vimeo.com/156115121','2014-08-25 00:00:00','After Effects','After Effects','这次做了这样的一个十分富有动感的动画。其实最有趣的是两边那两个旋转的particle emitter，是用了有相位差的三角函数做参数方程的呢。虽然现在看来也是挺简单的就是了。\n                        <!-- Description Summernote comes here -->\n                    ',0),(18,'aebb173c-9024-11e6-80c4-e5922c263bb3','Liby','Dream','梦',1,1,2,'https://vimeo.com/156115253','2014-08-27 00:00:00','After Effects','After Effects, Element 3D','最近看谜之声玩了一个叫做Dream的游戏。看到最后自己好像都要睡着了，虽然游戏算是“好看”，也很玄幻，做的东西也挺精致的，但是还是有点无聊。不过我突然想起来了它的开场动画，也就是我这次在模仿的东西，果然还是挺好看的。嗯。',0),(19,'0f21d85e-9025-11e6-80c4-e5922c263bb3','Liby','Time','时光流转着唏嘘',1,1,2,'https://vimeo.com/156115273','2014-08-29 00:00:00','After Effects','After Effects, Time','饿。。。并不知道这句词是什么意思，但是说起来好像很好听。我做特效的时间真的过得太快了，不知不觉几天就过去，又什么东西都没有做。这真是太不好了。不过这次的这个特效我真是挺满意的，Lens Blur，一直朝向摄像头的字，用Expression做的表盘和上面指针的动画，还有particular和form做出来的背景粒子，都是真的很有趣的！\n                        <!-- Description Summernote comes here -->\n                    ',0),(20,'966a1f14-9026-11e6-80c4-e5922c263bb3','Liby','Sincerity','阴阳相隔情犹在 魂返红尘与君别',1,1,2,'https://vimeo.com/156115297','2014-09-13 00:00:00','After Effects','After Effects, Hyouka, Sincerity, Umika','灵感取自Umika大大做的Sincerity这个AMV。想仿照那种感觉做出很朦胧梦幻的效果－－想象中，千反田在能从昏暗的那一侧世界亲吻到折木的那一刻的五彩缤纷的世界，大概就是这样的色彩吧。话说我这次真的成功用Fractal Noise做出了云雾的感觉诶。大概是多叠好几层就差不多了。话说回来Umika大真的好厉害好厉害啊。\n                        <!-- Description Summernote comes here -->\n                    ',0),(21,'9a95f8be-9027-11e6-80c4-e5922c263bb3','Liby','Mid-Autumn','中秋',1,1,2,'https://vimeo.com/156115312','2014-09-13 00:00:00','After Effects','After Effects, Mid-Autumn','好像听说学校有人放孔明灯？？然后做了这样的效果。。其实效果很烂，牛顿也哭晕在了厕所。不过模型是用Cinema4D搭出来的哦\n                        <!-- Description Summernote comes here -->\n                    ',0),(22,'a4864968-9028-11e6-80c4-e5922c263bb3','Liby','Through the Universe','开场动画',1,1,2,'https://vimeo.com/156115340','2014-09-17 00:00:00','After Effects','After Effects, Umika','<p>这个灵感是来自于Umika大大在Sincerity中做的第一幕场景。我觉得还原度还是很高的，不过最后少了千反田。</p><p>（后话：现在是2016年2月。刚刚听闻这个十分悲伤的消息。Umika大大居然逝去了。唔我真的好伤心啊，她真的给了我好多好多好多的启发和动力去做视频和特效。真心的，RIP，Umika<br></p><p>\n                        <!-- Description Summernote comes here -->\n                    </p>',0),(23,'e3bcba40-9028-11e6-80c4-e5922c263bb3','Liby','Cubes Studio','方块展开',1,1,2,'https://vimeo.com/156115360','2014-10-03 00:00:00','After Effects','After Effects, Cubes Studio','这次为Cubes Studio制作了一个小短片，这个方块及其父子关系其实我觉得用的十分巧妙－－是不是又要说到数学是非常伟大的学科呢。\n                        <!-- Description Summernote comes here -->\n                    ',0),(24,'6cb6dc2c-9029-11e6-80c4-e5922c263bb3','Liby','Sora','Fractal Noise Cloud',1,1,2,'https://vimeo.com/156115398','2014-10-25 00:00:00','After Effects','After Effects, Fractal Noise','不知道为什么突然想用Fractal Noise做一点东西出来。于是就变成了这个样子。果然还是跟云离不开（？Bug太多了。只是放上来凑数的。',0),(25,'bd1732ac-9029-11e6-80c4-e5922c263bb3','Liby','白くな未来','White Future',1,1,2,'https://vimeo.com/156115378','2014-10-25 00:00:00','After Effects','After Effects, Particular','<p>感觉未来就像这动画里的字一样飘散而去了啊，虽然写在那里，但是只是虚无缥缈的幻影罢了。</p><p>（我的申请季T T）</p>',0),(26,'f17ca2a6-902a-11e6-80c4-e5922c263bb3','Liby','Rain','強い雨',1,0,0,'https://vimeo.com/156115456','2014-11-03 00:00:00','After Effects','After Effects, Particular, ks-product','这次仿照了ks-project的一个trapcode particular小实验。这个效果做的真的很满意！\n                        <!-- Description Summernote comes here -->\n                    ',0),(27,'bdc5b5e6-9049-11e6-80c4-e5922c263bb3','Liby','Through Innovation','Abstract Ribbon',1,1,2,'https://vimeo.com/156115844','2015-06-11 00:00:00','Cinema 4D, After Effects','After Effects, Ribbon, Abstract','主要用到Ae中的Plexus插件，Ribbon的模型则是在Cinema4D里面几分钟搞出来的乱七八糟的几何体。其实最后好好调色，好好构图之后这张图显得十分高冷啊。(所以说Innovation其实只是拿来装逼用的（（（（\n                        <!-- Description Summernote comes here -->\n                    ',0),(28,'290a79ae-904a-11e6-80c4-e5922c263bb3','Liby','Colorful Wave','Vector Blur',1,1,1,'','2014-11-03 00:00:00','After Effects','After Effects, Vector Blur','其实实在不好看，也不怎么像波纹，但是技巧倒是十分有趣，Particular + Vector Blur这效果实在很有意思。',0),(29,'55558850-90c7-11e6-80c4-e5922c263bb3','Liby','Obsidian','Be Enlightened',1,1,2,'https://vimeo.com/156116192','2016-02-04 00:00:00','After Effects','After Effects, Ingress, Obsidian','<p>2016年4月的Obsidian全球大型集会，Enlightened拯救世界的狂欢！虽然这么说，但是这次肯定是参加不了了。还是将这个题材作为练习吧。灵感来自于Ethern君，这次彻底明白了Trapcode Shine的神奇用法。Logo的话则是照搬了之前SMS Enlightment的模型。希望这次的效果能向大家传达出「世界将被绿化」这样的感觉呢～</p><p>P.S.话说回来Ingress的美工死了么＝＝。<br></p><p>\n                        <!-- Description Summernote comes here -->\n                    </p>',0),(30,'b1527cbc-90c7-11e6-80c4-e5922c263bb3','Liby','Shockwave Experiment','Shock------',1,1,2,'https://vimeo.com/156115473','2015-02-12 00:00:00','After Effects','After Effects, Shock Wave, Video Copilot','刚搞到了Shockwave的素材包，于是急不可耐地用Element 3D加上破碎的效果试验了一下',0),(31,'928cf896-9425-11e6-80c4-e5922c263bb3','Liby','None','Christmas in the Silent Forest I',1,0,2,'https://vimeo.com/187607292','2016-10-16 21:45:00','Cinema 4D, After Effects, Premiere','Cinema 4D, After Effects, Premiere, Yoko Kanno, Ghost in the Shell, Christmas in the Silent Forest, ','最近突然超级喜欢听Christmas in the Silent Forest这首曲子。菅野洋子的风格真的是赞的不行。想起来前几天又看到Ash Thorp做了点新东西，那个的风格我也是超级喜欢的。受到了一些启发，于是想这次认真剪一个AMV，给攻壳机动队还有可爱的タチコマ。这个片段渲染的话大概就是最后会有的效果吧？就当作预告吧_(:з」∠)_',0),(42,'d7b6c4b8-974c-11e6-a6b8-b6ba83615dae','Liby','Twist Experiment','Element 3D Deformation',1,1,2,'https://vimeo.com/156115491','2015-02-16 00:00:00','After Effects','After Effects, Element 3D, Deformation','看了Element 3D的教程之后就做了这个东西，还算是挺好玩的。这次强行好好调了一次色<!-- Description Summernote comes here -->',0);
