INSERT INTO `comment` VALUES (1,'3c22cb50-8621-11e6-a53a-5c0f38edfc28','0f4ad1ca-85d3-11e6-a53a-5c0f38edfc28',NULL,'Tonny(False)','tonny@tonny.me',0,0,'2016-09-29 01:30:51','I\'m just testing though...'),(2,'e3949260-862b-11e6-a53a-5c0f38edfc28','0f4ad1ca-85d3-11e6-a53a-5c0f38edfc28',NULL,'Enddle(Fake)','enddle@enddle.me',0,0,'2016-09-29 03:02:54','Hahahaha, 这是一个看起来很长长长长长长长长长  长长长长长长长长长长长长长长长的评论，只是为了测试而已，为什么呢，为什么会这么熟练呢?'),(3,'f0314536-862b-11e6-a53a-5c0f38edfc28','0f4ad1ca-85d3-11e6-a53a-5c0f38edfc28',NULL,'Enddle(Fake)','enddle@enddle.me',0,1,'2016-09-29 03:03:15','这个评论也要被用来做测试，嗯。'),(4,'f5af760e-862b-11e6-a53a-5c0f38edfc28','0f4ad1ca-85d3-11e6-a53a-5c0f38edfc28',NULL,'Enddle(Fake)','enddle@enddle.me',0,0,'2016-09-29 03:03:24','话说终于可以用中文了（？真好'),(5,'fdca93be-862b-11e6-a53a-5c0f38edfc28','0f4ad1ca-85d3-11e6-a53a-5c0f38edfc28',NULL,'Enddle(Fake)','enddle@enddle.me',0,0,'2016-09-29 03:03:38','我是Tonny（伪'),(6,'8112d158-8dc7-11e6-80c4-e5922c263bb3','fff2b12c-8d41-11e6-80c4-e5922c263bb3',NULL,'Tester','liby99@icloud.com',0,0,'2016-10-08 19:24:28','Comment test!'),(7,'3c4524f2-8dc9-11e6-80c4-e5922c263bb3','fff2b12c-8d41-11e6-80c4-e5922c263bb3',NULL,'Tester','liby99@icloud.com',0,0,'2016-10-08 19:36:52','I\'m going to test again!'),(8,'976061ba-8dee-11e6-80c4-e5922c263bb3','e7eb5882-8de0-11e6-80c4-e5922c263bb3',NULL,'Tester','testing@testing.com',0,0,'2016-10-09 00:04:16','Inso真不错_(:з」∠)_'),(9,'0dc6cd4a-92b2-11e6-80c4-e5922c263bb3','85f0634e-8db2-11e6-80c4-e5922c263bb3',NULL,'Hahaha','test@test.com',0,0,'2016-10-15 01:33:31','Testing... Should be fine... ');
